        [Test]
        public void OrdinarySorterTest()
        {
            var sorter = new OrdinarySorter();
            TestSorter(sorter);
        }

        [Test]
        public void BubbleSortTest()
        {
            var sorter = new BubbleSort();
            TestSorter(sorter);
        }

        [Test]
        public void HeapSortTest()
        {
            var sorter = new HeapSort();
            TestSorter(sorter);
        }

        [Test]
        public void QuickSortTest()
        {
            var sorter = new QuickSort();
            TestSorter(sorter);
        }

        private void TestSorter(ISorter sorter)
        {
            var unsortedDataResult = sorter.Sort(unsortedData);
            var sortedDataResult = sorter.Sort(sortedData);
            var equalDataResult = sorter.Sort(equalData);

            Assert.AreEqual(sortedData, unsortedDataResult);
            Assert.AreEqual(sortedData, sortedDataResult);
            Assert.AreEqual(equalData, equalDataResult);
        }
    }
